import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  grid-area: intro;
  text-align: center;
`;

const Introduction = () => {
  return (
    <Container className="intro">
      Bishop and Polden
    </Container>
  );
};

export default Introduction;
